import { createApp } from 'vue'
import App from './App.vue'
import {create} from 'naive-ui';
import router from './router'; 
import store from './store'; // 引入状态管理

const naive = create();

const app = createApp(App);
app.use(naive);
app.use(router);
app.provide('store', store); // 使用状态管理
app.mount('#app');


